import React from 'react';
import ReactDOM from 'react-dom';

const name = "Sultan Akhter"

ReactDOM.render(
    <>
    <h1>
        {`My name is ${name}`}
    </h1>
    <p>
        {Date()}
    </p>
    <p></p>
</>
    ,
    document.getElementById('root'));
